import React from 'react'
import { connect } from "react-redux";

import { toggleAvailableUnits, toggleUnitsInUse, toggleQuarantinedUnits, toggleAddUser, toggleAddUnit } from "../../redux/pop-ups/pop-ups.actions";

import { RightContainer, RightInnerContainer,ActionHeader ,ReportLink } from "./right.styles";

const ReportsContainer = ({ toggleAvailableUnits, toggleUnitsInUse, toggleQuarantinedUnits, toggleAddUser, toggleAddUnit }) => {
    return (
        <RightContainer>
            <ActionHeader>ACTIONS</ActionHeader>
            <RightInnerContainer>
                <ReportLink onClick={toggleAddUser}          >ADD NEW USER   </ReportLink>
                <ReportLink onClick={toggleAddUnit}          >ADD NEW ASSET  </ReportLink>
                <ReportLink onClick={toggleUnitsInUse}       >ASSETS IN USE    </ReportLink>
                <ReportLink onClick={toggleAvailableUnits}   >AVAILABLE ASSETS  </ReportLink>
                <ReportLink onClick={toggleQuarantinedUnits} >QUARANTINED ASSETS</ReportLink>
            </RightInnerContainer>
        </RightContainer>
    )
}

const mapStateToProps = (state) => ({
    seenAvailableUnits  : state.popUpState.seenAvailableUnits,
    seenQuarantinedUnits: state.popUpState.seenQuarantinedUnits,
    seenAddUser         : state.popUpState.seenAddUser,
    seenAddUnit         : state.popUpState.seenAddUnit
});

const mapDispatchToProps = dispatch => ({
    toggleAvailableUnits  : () => dispatch(toggleAvailableUnits()),
    toggleQuarantinedUnits: () => dispatch(toggleQuarantinedUnits()),
    toggleUnitsInUse      : () => dispatch(toggleUnitsInUse()),
    toggleAddUser         : () => dispatch(toggleAddUser()),
    toggleAddUnit         : () => dispatch(toggleAddUnit())
  });

export default connect(mapStateToProps, mapDispatchToProps)(ReportsContainer);
